INSERT INTO `exp_channel_data` VALUES (1,1,1,'ChannelImages','xhtml','The Counter es un restaurante donde los clientes pueden armar sus propias hamburguesas eligiendo y combinando los diferentes ingredientes del menú. Esto permite que los usuarios usen su creatividad para inventar su hamburguesa ideal.','none','http://www.thecounterburger.com','none','restaurant, customization, burger, menu, food and beverage, experience, creative, ingredients, choices, online\n','none','','none','comida\ncrea\ncreatividad\ncustomización\nelección\nexperiencia\nhamburguesa\ningredientes\nmenu\nrestaurante','xhtml','','none','','none'),(2,1,1,'ChannelImages','xhtml','Mission Bike se formó para construir las bicicletas más bonitas, prácticas y personalizables del mercado. Cada bicicleta es diseñada por el propio ciclista y luego ensamblada a mano en San Francisco. Tanto en persona como online, Mission Bike guía paso a paso al cliente en el diseño de una bicicleta que se ajuste a sus necesidades y personalidad.','none','https://www.missionbicycle.com/bike-builder','none','retail, customization, bicycle, cycling, athletic, sports, innovation, mission, lifestyle, design, personalization, purchasing, culture, experience, online','none','','none','bicicleta\ncultura\ncustomización\ndeportes\ndiseño\nestilo\nestilo de vida\nexperiencia\ninnovación\nonline\npersonalización\nretail','xhtml','','none','','none'),(3,1,1,'ChannelImages','xhtml','Timbuk2 es una marca que confecciona mochilas y accesorios customizables, funcionales y que durarán toda una vida. El cliente tiene el poder de personalizar su mochila, eligiendo desde el estilo y los colores, hasta los materiales. Todo esto lo pueden hacer remotamente utilizando la página web, o en la tienda usando las pantallas táctiles.','none','http://www.timbuk2.com/','none','retail, customization, backpack, bags, lifestyle, design, online, durability, functionality, fashion, touch screen, accessibility, accessories, bicycle','none','','none','accesibilidad\nbicicleta\ncustomización\ndiseño\nestilo de vida\nfashion\nfuncionalidad\nmochila\nmoda\nonline\npantalla táctil\npersonalización\nretail','xhtml','','none','','none'),(4,1,1,'ChannelImages','xhtml','La tienda de ropa Uniqlo cuenta con un \"Espejo Mágico\" que ayuda a los compradores a decidir que prenda comprar sin tener que probarse todas las alternativas de colores disponibles. Uno se prueba una prenda frente al espejo y la pantalla táctil te invita a seleccionar colores que son proyectados digitalmente sobre tu reflejo. Desarrollado por Holition en Inglaterra, este probador virtual usa la tecnología de cambio de color de Kinect y un panel táctil mitad espejo para hacer \"la magia\".','none','http://www.uniqlo.com/','none','mirror, digital, technology, fashion, retail, color, store, dressing room,  tech, interactive, virtual, touch screen','none','http://retail-innovation.com/uniqlos-magic-mirror/','none','color\ndigital\nespejo\nexperiencia\nfashion\ninteractiva\nmoda\npantalla táctil\nprobador\nretail\ntech\ntecnología\ntienda\ntouch screen\nvirtual','xhtml','','none','','none'),(5,1,1,'ChannelImages','xhtml','Target está probando una plataforma en su sitio web donde el comercio electrónico se combina con las redes sociales. El \"Target Awesome Shop\" es una vitrina virtual que exhibe artículos recomendados en Pinterest, aquellos que tienen mayores \"Pins\".\n','none','http://awesomeshop.target.com','none','retail, pinterest, target, online, crowdsourcing, social media, data mining, e-commerce, recommendations, fashion','none','http://techcrunch.com/2013/12/09/target-experiments-with-a-pinterest-powered-online-storefront-dubbed-the-awesome-shop/','none','base de datos\ncomercio electrónico\ncrowdsourcing\ncuración\ndata\ne-commerce\nestilo de vida\nlifestyle\nmoda\nonline\npinterest\nrecomendación\nred social\nretail\nsocial media\ntarget','xhtml','','none','','none'),(6,1,1,'ChannelImages','xhtml','El retailer Brasileño C&A cuenta con unos colgadores de ropa muy especiales ya que muestran, en tiempo real, cuantos \"Me Gusta\" ha recolectado cada prenda en su comunidad de Facebook. Estos colgadores digitales estimulan tanto las compras basadas en la popularidad como las discusiones de moda en las redes sociales.','none','http://www.cea.com.br/lojas','none','fashion retail, facebook, like, retail, hanger, technology, digital, real time, social media, data mining','none','http://www.cnet.com/news/hangers-with-like-counts-let-facebook-dictate-fashion/','none','base de datos\ncolgador\ncrowdsourcing\ndigital\ndisplay\nfacebook\nfashion\nlike\nme gusta\nmoda\nnetwork\nred social\nretail\nsocial media\ntecnología\ntiempo real','xhtml','','none','','none'),(7,1,1,'ChannelImages','xhtml','Kickstarter es la plataforma de financiamiento para proyectos de inversión en línea más grande del mundo. Ayuda tanto a compañías como a individuos a obtener \"patrocinadores\" para el momento de producción de la idea. Así, son los mismos consumidores los que eligen que productos o servicios se harán realidad.','none','https://www.kickstarter.com/?ref=nav','none','business, data mining, social media, backers, community, crowdsourcing, online, start-up, project, crowdsourcing, crowdfunding, investment, online, platform','none','','none','base de datos\ncomunidad\ncrowdsourcing\ndata\nemprendimiento\ninversión\nnegocios\nonline\nplataforma\nsocial media\nstart-up','xhtml','','none','','none'),(8,1,1,'ChannelImages','xhtml','Una comunidad online de ropa donde los usuarios co-diseñan y co-financian sus productos materializándolos en cuestión de semanas. Cualquier persona puede crear un diseño, subirlo a la plataforma. Si este recibe una buena aceptación del público, Betabrand lo produce e inserta al mercado.','none','http://www.betabrand.com','none','clothing, co-create, community, crowdfunding, crowdsourcing, design, experience, fashion, fashion retail, online, purchasing, retail, think tank, san francisco','none','','none','compra\ncomunidad\ncrowdsourcing\ndiseño\nemprendimiento\nfashion\nmoda\nonline\nretail\nropa','xhtml','','none','','none'),(9,1,1,'ChannelImages','xhtml','Quirky es una plataforma web de \"crowdfounding\" donde cualquier persona puede exponer su idea de negocio. Durante los siguientes 30 días los miembros de la comunidad podrán votar y comentar acerca del concepto y diseño de la idea. Las ideas más votadas son evaluadas por el equipo de Quirky, quien a su vez elige finalistas para avanzar en el desarrollo del producto. Una vez que el producto está finalizado y empieza a vender, el usuario que lo creó gana el derecho a regalías de por vida sobre las ventas de su invento. Esto incentiva la innovación y la participación del consumidor.','none','https://www.quirky.com/','none','community, contest, crowdsourcing, design, invention, online, platform, product, retail, royalties, start-up, vote','none','','none','co-creación\ncomunidad\nconcurso\ndiseño\nemprendimiento\ninnovación\ninvento\nnegocio\nplataforma\nretail\nstart-up\nvoto','xhtml','','none','','none'),(10,1,1,'ChannelImages','xhtml','Drybar viene del concepto \"blow dry bar\", una idea muy simple: no cortes, no tinte, sólo secado a $40. Se centra en la experiencia y en cómo hacen sentir a las personas. Tienen detalles interesantes como una carta de peinados, un libro con sugerencias de estilos y café, te o champagne servidos de cortesía.','none','http://www.thedrybar.com','none','Redefining atmosphere, San Francisco, USA, Beauty, Make the ordinary extraordinary','none','','none','belleza\ncabello\nestilo\nestilo de vida\nexperiencia\nlook\npeinado\nsalon\nsecado\nservicio\ntarifa plana','xhtml','','none','','none'),(11,1,2,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'',NULL,'lavictoria','none','lab001','none'),(27,1,1,'ChannelImages','xhtml','Lululemon es una tienda de ropa para correr y hacer yoga que tiene lazos muy fuertes con las comunidades locales. Lululemon no solo vende ropa, además promueve eventos que van desde defensa personal, talleres de establecimiento de coaching hasta clases de yoga gratuitas a cargo de embajadores o expertos dentro de la comunidad. Las tiendas cuentan con una sección donde se exhiben a los \"héroes locales\", expertos en yoga que forman parte de la comunidad \"Lululemon\".','none','http://www.lululemon.com','none','','none','','none','comunidad\ndeporte\nejercicios\neventos\nfitness\nhéroes\nretail\ntienda\ntribus\nyoga','xhtml','',NULL,'',NULL),(12,1,1,'ChannelImages','xhtml','Santana Row es un centro comercial al aire libre ubicado en San José, California. Fue diseñado para replicar la atmósfera de un barrio europeo con plazas abiertas, áreas verdes, lugares para sentarse y veredas amplias. Además, cuenta con espacios multiuso donde se promueve la música en vivo y otras intervenciones públicas. ','none','http://www.santanarow.com','none','','none','shopping','none','actividades\ncentro comercial\nconciertos\nespacio público\neventos\nexperiencia\nexteriores\nmall\nmultiuso\nplaza\nshopping','xhtml','',NULL,'',NULL),(28,1,1,'ChannelImages','xhtml','Dandelion Chocolate es una fábrica de chocolate que se enfoca en crear una experiencia compartiendo con el cliente todo el proceso desde la cemilla de cacao hasta la barra de chocolate.  Se encuentra localizado en el distrito Mission en San Francisco y promueve una atmósfera de aprendizaje.','none','http://www.dandelionchocolate.com','none','','none','','none','aprendizaje\nchocolate\ncomida\ndulce\neducación\nexperiencia\nfábrica\ninteractivo\nmuseo\nnatural\nsabor','xhtml','',NULL,'',NULL),(14,1,1,'ChannelImages','xhtml','La sede bandera del Banco Umpqua es un espacio comunitario que reinventa el concepto de un banco tradicional, ofreciéndole a sus clientes acceso a salas de reuniones, a un centro de recursos (con WI FI, computadoras, pantallas digitales interactivas y acceso a insights de distintas industrias), ofrece también una sala de negocios donde puedes conocer y planear con expertos y posibles socios, así como eventos ofrecidos frecuentemente para la comunidad. El banco ha construido una relación importante con la comunidad y presenta negocios, productos y empresarios de la localidad.','none','http://sf.umpquabank.com','none','','none','','none','banco\nbusiness\ncentro\ncomunidad\ndigital\nexperiencia\nlocal\nnegocios\nreunion\nsocial\ntrabajo','xhtml','',NULL,'',NULL),(15,1,1,'ChannelImages','xhtml','Las cafeterías para gatos y para mascotas en general se han vuelto muy populares en países como Corea y Japón debido a que en muchos departamentos pequeños se restringe la tenencia de mascotas. Tom´s Cat Café en Corea ofrece un espacio para que juegues con 20-30 gatos mientras disfrutas de una bebida usando pantuflas muy cómodas provistas por el local.','none','','none','','none','https://springenchantment.wordpress.com/2013/09/11/seoul-searching-ycat-cafe-in-hongdae','none','animales\natmósfera\ncafe\ncoffee\nexperiencia\ngato\ngatos\ninteracción\nshop','xhtml','',NULL,'',NULL),(16,1,1,'ChannelImages','xhtml','The Legaspi Company ubicada en el sudoeste de Estados Unidos, está remodelando centros comerciales para adaptarlos a las demandas culturales. Este centro comercial se dirige a la comunidad latina por lo que celebra eventos y festividades hispanas y vende productos atractivos para este público. ','none','www.thelegaspi.com','none','','none','http://www.fastcompany.com/most-innovative-companies/2014/the-legaspi-company','none','centro comercial\ncomunidad\ncultura\neventos\nexteriores\nlatinos\nmall\nshopping\ntribus','xhtml','',NULL,'',NULL),(17,1,1,'ChannelImages','xhtml','Capital One 360º Café es un espacio comunitario creado por Capital One Bank para que sus clientes se sientan especiales. Es un lugar de reunión donde las personas pueden juntarse para tomar un café, socializar con amigos o navegar en la web. Es también un espacio de trabajo con salas privadas de reuniones. ','none','http://cafes.capitalone360.com/san_francisco','none','','none','','none','banco\ncafe\ncafetería\ncomunidad\nespacio comunitario\nexperiencia\nreunion\nservicio\ntercer lugar\nthird place\ntrabajo','xhtml','',NULL,'',NULL),(18,1,1,'ChannelImages','xhtml','E-Mart Store, el retailer más grande de Corea del Sur, creó un activación con el objetivo de incrementar las ventas durante su peor momento del día: el almuerzo. Se diseñó una escultura en 3D de un código QR para exhibirla al exterior de la tienda entre las 12pm y 1pm. Los transeúntes que tomaran una fotografía del código QR obtendrían un enlace a ofertas y descuentos especiales. Esta activación incrementó en un 25% las ventas de E-Mart.','none','http://emart.ssg.com/main.ssg','none','','none','https://www.youtube.com/watch?v=EvIJfUySmY0','none','almuerzo\ncódigo\nescultura\nespacio público\ninnovación\noferta\npromoción\nqr\nretail\nsupermercado\ntiempo','xhtml','',NULL,'',NULL),(19,1,1,'ChannelImages','xhtml','El MIT, junto con una organización de Hong Kong, ha desarrollado un robot que transforma fotografías de personas en caricaturas y las aplica sobre una taza de papel. Esta idea fue ofrecida a Starbucks para ser usada como el substituto digital de los tradicionales nombres escritos a mano en las tazas.','none','starbucks.com','none','','none','','none','arte\nbebida\ncafé\ncafetería\ncomida\ndigital\ndiseño\nmit\npersonalización\nstarbucks\ntecnología','xhtml','',NULL,'',NULL),(20,1,1,'ChannelImages','xhtml','Shopkick es una app de compras que ayuda a los usuarios a descubrir productos vinculados a sus intereses personales y que se encuentran en tiendas cercanas a donde están. La aplicación envía notificaciones a los usuarios cuando estos se encuentran cerca a sus tiendas favoritas y además los premia con puntos por entrar a las mismas; los cuales pueden ser canjeados luego por certificados de regalo y descuentos especiales.','none','http://shopkick.com/','none','','none','','none','app\ncompras\ndigital\ngamification\nincentivo\nmoda\nmovil\nonline\npersonalización\npremio\nreta