'',NULL,'',NULL),(169,1,1,'ChannelImages','xhtml','Conocido bajo las siglas LTO (Limited Time Only), LTO es un restaurante que cambia su carta frecuentemente a través de un sistema de rotación de chefs. Esto le da a los chefs la oportunidad de mostrar su trabajo y a los comensales de probar diferentes estilos de cocina. LTO presenta chefs tanto renombrados como desconocidos en el mundo culinario, quiénes dirigen la cocina por una semana y hasta por un mes.','none','http://www.kitchenlto.com','none','','none','http://www.businessinsider.com/most-innovative-businesses-in-nyc-2013-2?op=1','none','alimentos\ncambio\ncheff\ncomida\nitinerante\nlimitado\nlimite\nlto\nmenu\nnew york\nrestaurante\nrotación\nservicio\ntiempo','xhtml','',NULL,'',NULL),(170,1,1,'ChannelImages','xhtml','inSelly es un comercio electrónico que facilita la compra y venta a través de Instagram. Una vez que los usuarios hayan integrado sus cuentas de Instagram con sus cuentas de inSelly, pueden poner a la venta distintos artículos tomándoles una foto, subiéndola y etiquetándola con el hashtag #inselly. Los consumidores entonces podrán comprar los artículos fácil y rápido vía Paypal. Las ofertas pueden ser encontradas en la red usando distintos criterios de búsqueda.','none','http://inselly.com/','none','','none','','none','app\nbúsqueda\ncompra\ncomunidad\ncontacto\ndigital\ne-commerce\ne-mart\netiqueta\nhashtag\ninstagram\ninternet\nmercado libre\nofertas\nonline\nredes sociales\nventa\nweb','xhtml','',NULL,'',NULL),(171,1,1,'ChannelImages','xhtml','El Skygarden es un gran parque junto a mall en Indonesia, el cual sirve de puente orgánico entre los diferentes componentes del centro comercial y la carretera. Skygarden se eleva desde la carretera y suaviza el duro entorno urbano con una exhibición de tierra exuberante y paisajes acuáticos, lo que permite que las personas se sientan más cerca a la naturaleza pero en un espacio seguro dentro de las instalaciones del centro comercial.','none','http://www.sm-northedsa.com/attractions/the-skygarden','none','','none','http://www.complex.com/pop-culture/2013/07/the-50-coolest-malls-in-the-world/sm-city-n-edsa','none','arquitectura\ncentro comercial\ncomplejo\ncomunidad\necológico\nentretenimiento\nespacio comunitario\nespacio público\nexhibición\njardin\nmall\nnaturaleza\nparque\nurbanismo','xhtml','',NULL,'',NULL),(172,1,1,'ChannelImages','xhtml','El Centro Comercial Cevahir en Estambul es el segundo más grande del mundo y cuenta con una montaña rusa gigante dentro del mall, cuyo recorrido bordea el sexto piso del mismo. Han logrado convertir el mall en más que un destino de compras, en una experiencia de entretenimiento en familia. ','none','http://www.istanbulcevahir.com','none','','none','','none','actividades\ncentro comercial\ndiversion\nentretenimiento\nestambul\nevento\nexperiencia\nfamilia\nmall\nservicio','xhtml','',NULL,'',NULL),(173,1,1,'ChannelImages','xhtml','El Centro Comercial \"The Sarit Center\", conocido popularmente como \"La Ciudad en La Ciudad\" ofrece la experiencia de comprar todo en un mismo lugar y ha impactado enormemente el retail en África del Este. Ubicado en la capital de Kenia, ha aplicado la resiliencia para convertirse en mucho más que un centro comercial, en medio de la crisis política que atraviesa. Es una especie de incubadora que impulsando a sus primeros inquilinos mediante el apoyo al turismo interno organizando festivales dentro del centro comercial.','none','http://www.saritcentre.com','none','','none','http://www.theneweconomy.com/business/city-within-a-city-sarit-centre-changes-african-retail-forever','none','africa\ncentro comercial\ncomunidad\nentretenimiento\nevento\nexperiencia\nfamilia\nimpacto\nmall\nmercados emergentes\nnairobi\none stop destination\nservicio','xhtml','',NULL,'',NULL),(174,1,1,'ChannelImages','xhtml','Meydan Mall es un centro comercial en Turquía que mezcla parques, espacios públicos y tiendas de una forma muy especial. El techo, que está a nivel del suelo, está lleno de árboles y jardines formando un impresionante techo ecológico. Toda la estructura fue diseñada para que las tiendas, que están bajo el parque, estén siempre iluminadas y aireadas.','none','http://inhabitat.com/meydan-shopping-complex-is-a-massive-green-roofed-mecca-in-istanbul/foa-meydan-shopping-center-7/?extend=1','none','','none','','none','ambiente\narquitectura\ncentro comercial\ncomunidad\ndiseño\necológico\nespacio público\nexperiencia\njardín\nmall\nmercados emergentes\nparque\nretail\nservicio\ntecho verde\nverde','xhtml','',NULL,'',NULL),(175,1,1,'ChannelImages','xhtml','Pracownia Wnętrz es una tienda de diseño que a la vez funciona como taller creativo para niños y adultos. Inicialmente fue diseñada para ser un espacio en el que los arquitectos se pudieran reunir con sus clientes. Ahora, además, cuenta con exhibiciones itinerantes de productos de diseño, un salón de espera, una zona de recreación donde ofrecen café, snacks y libros; y una sala de conferencias.','none','http://pracowniawnetrza.com.pl','none','','none','','none','arquitectura\nco-trabajo\nco-work\ncompartir\ndiseño\nespacio\nexhibición\nexhibidor\nfeedback\nnicho\npop-up\npunto de venta\nretail\ntaller\ntienda','xhtml','',NULL,'',NULL),(176,1,1,'ChannelImages','xhtml','El Hipermercado Carrefour de Indonesia lanzó un comercio electrónico denominado \"Carrefour Click & Drive\" que le permite a sus clientes comprar y pagar en internet, y luego recoger sus compras en el local y hora de su preferencia. ','none','','none','','none','','none','compra\ncomunicación\ndelivery\ndigital\ndrive-thru\neficiencia\nentrega\nfacilidad\nindonesia\ninternet\nmercados emergentes\nonline\nsupermercado','xhtml','',NULL,'',NULL),(177,1,1,'ChannelImages','xhtml','En India, las personas intencionalmente se llaman entre sí, dejan que suene una vez o dos veces, y cuelgan. Esta es una forma de enviar señales como \"estoy en casa\", sin tener que pagar por una llamada. Zipdial decidió aprovechar esta costumbre y lanzó un servicio que permite a los clientes comunicarse con diversas compañías, a las cuales se les asigna un número. Cuando los clientes llaman, dejan timbrar el teléfono una o dos veces y luego cuelgan. La compañía les devuelve la llamada o reciben un mensaje de texto, y automáticamente participan de concursos o reciben cupones de descuento. ','none','https://zipdial.com/corp/','none','','none','http://www.fastcompany.com/most-innovative-companies/2014/zipdial','none','automático\ncampaña\ncódigo\ncomunicación\ncomunidad\ncupon\ndescuento\nindia\nllamada\nmercados emergentes\nmovil\nplataforma\ntelecomunicaciones\nteléfono\ntexto','xhtml','',NULL,'',NULL),(178,1,1,'ChannelImages','xhtml','Three Buns Burger es un restaurante ubicado en un mercado completamente remodelado. La estructura del lugar (vidrio transparente, árboles, mesas de picnic y camiones de comida) da la sensación que uno se encuentra en un parque o espacio abierto. La comida se compra en una camioneta VW estacionada en medio del espacio y luego los clientes la disfrutan bajo la sombra de los árboles que se encuentran al interior de este interesante local.','none','http://www.threebuns.com/','none','','none','','none','alimentos\narquitectura\ncentro comercial\ncomida\ndiseño\nespacio comunitario\nespacio público\nexperiencia\nfood court\nfood truck\nlocal\nmall\nmercado\nmercados emergentes\npicnic\nrestaurante','xhtml','',NULL,'',NULL),(179,1,1,'ChannelImages','xhtml','Custore es un proyecto experimental en el centro comercial Zlote Tarasy ubicado en Varsovia. Se trata de una combinación de galería de arte con una tienda de tipo \"pop up\". Ha sido construída con materiales cálidos como la madera, de tal forma que recibe aire de afuera y luz solar, convirtiéndolo en un espacio muy acogedor.','none','http://retaildesignblog.net/2013/07/19/custore-pavilion-anna-dobek-and-mateusz-wojcicki-warsaw-poland/','none','','none','','none','ambiente\narquitectura\narte\ncentro comercial\ndiseño\nespacio\nexperiencia\ngalería\npop up\nropa\nshopping\ntienda','xhtml','',NULL,'',NULL),(180,1,1,'ChannelImages','xhtml','CAMP es un espacio abierto para la comunidad ubicado dentro del Centro Comercial Maya en Tailandia. Se ha convertido en un espacio muy popular entre los visitantes del CC y jóvenes estudiantes, quiénes por la compra de una bebida o algo de comer, pueden usar 2 horas gratuitas de WiFi, sentarse a leer libros en la biblioteca, echarse a dormir una siesta en cualquier parte, trabajar, cargar sus celulares, compartir comida con amigos o simplemente pasar el rato.','none','http://www.chiangmaibuddy.com/best-coworking-spaces-in-chiang-mai/','none','','none','','none','biblioteca\ncafé\ncafetería\nco-work\ncompartir\ncomunidad\ncurador\ndiseño\nencuentro\nespacio de trabajo\nmercados emergentes\nnomade\nreunion\nselección\nservicio\nwifi','xhtml','',NULL,'',NULL),(181,1,1,'ChannelImages','xhtml','Kidzania es un mundo educacional a escala niños dentro de centros comerciales a nivel global. El espacio es exclusivo para niños, y los padres los esperan en áreas designadas relajándose y monitoreándolos a través del GPS incorporado en brazaletes que cada niño usa. En KidZania, los niños abren una cuenta de ahorros y tienen un trabajo como con el que aprenden sobre emprendimiento, economía y finanzas personales. Sus instalaciones incluyen aeropuertos, pasaportes, comisarías, estadios, cines, tiendas, universidades, bancos, concesionarios de Sushi, Pizza, etc.','none','http://www.kidzania.com','none','','none','','none','aprender\ncomunidad\nconcepto\neducación\nentretenimiento\nespacio\nexperiencia\ninformación\nniños\nparque de diversiones\nservicio\ntema','xhtml','',NULL,'',NULL);
